import React from "react";
import ReactDOM from "react-dom";
import ContactCard from './ContactCard';

function App() {
  return (
    <div className="App">
      <ContactCard 
        name="Griffin" 
        imgUrl=""
        phone="(212) 123-4567"
        email="griffin@gmail.com"/>

      <ContactCard 
        name="Olimjon" 
        imgUrl=""
        phone="(212) 123-1235"
        email="Olimjon@gmail.com"/>

      <ContactCard 
        name="Emmanuel" 
        imgUrl=""
        phone="(212) 123-6436"
        email="Emmanuel@gmail.com"/>

      <ContactCard 
        name="Malik" 
        imgUrl=""
        phone="(212) 123-3234"
        email="Malik@gmail.com"/>

    </div>
  );
}

export default App;
